const Total = ({allFeedback, good, bad, neutral}) => {
	return (
			<p> {good} <br />
			 {neutral} <br />
			 {bad} <br />
			 {allFeedback.length} <br />
			 {parseFloat((good-bad)/(allFeedback.length))} <br />
			 {parseFloat((good)/(allFeedback.length))} %</p>
	)
}

export default Total;
